import './sidebar.css'
import avt from '../../../img/avt.jpg';
import Item from './item';
import { faHouse } from '@fortawesome/free-solid-svg-icons'

function Sidebar() {
    return (
        <div className="sidebar">
            <div className="circle-container">
                <img src={avt} alt="" className="circle-image"></img>
            </div>
            <label>Name</label>
            <Item 
                icon= {faHouse}
                title= "PROPERTIES"
            />
            <Item 
                icon= {faHouse}
                title= "CHAT"
            />
            <Item 
                icon= {faHouse}
                title= "CAR"
            />
            <Item 
                icon= {faHouse}
                title= "PROPERTIES"
            />
            <Item 
                icon= {faHouse}
                title= "PROPERTIES"
            />
            <Item 
                icon= {faHouse}
                title= "PROPERTIES"
            />
        </div>
    );
}

export default Sidebar;
